import React, { useContext, useEffect } from 'react'
import { useNavigate, useParams } from 'react-router-dom'
import { BookContext } from '../cAPI'
import BookFinder from '../Apis/BookFinder'

const BookDetail = (props) => {
  const {isbn} = useParams()
  const {selectedBook, setSelectetBook} = useContext(BookContext)
  const navigate = useNavigate()

  console.log (isbn);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await BookFinder.get(`/${isbn}`);
                setSelectetBook(response.data.data.books)
                console.log(response.data.data.books);
            } catch (err) {
                console.log(err);
            }
        }
        fetchData();
    },[])

    if (selectedBook){
        const handleDelete = async (e, isbn) => {
            e.stopPropagation();
            try {
                const response = await BookFinder.delete(`/${isbn}`);
                console.log(response);
                navigate(`/`)
            } catch (err) {
                console.log(err);
            }
        }

        return (
            <div className="list-group">                
                <form>
                    <div class="mb-3">
                        <label class="form-label" for="isbn">ISBN</label>
                        <input class="form-control" type="text" value={selectedBook.isbn} disabled readonly />
                    </div>

                    <div class="mb-3">
                        <label class="form-label" for="title">Title</label>
                        <input class="form-control" type="text" value={selectedBook.title} disabled readonly />
                    </div>

                    <div class="mb-3">
                        <label class="form-label" for="author">Author</label>
                        <input class="form-control" type="text" value={selectedBook.author} disabled readonly />
                    </div>

                    <div class="mb-3">
                        <label class="form-label" for="year">Year</label>
                        <input class="form-control" type="text" value={selectedBook.year} disabled readonly />
                    </div>

                    <div class="mb-3">
                        <label class="form-label" for="publisher">Publisher</label>
                        <input class="form-control" type="text" value={selectedBook.publisher} disabled readonly />
                    </div>

                    <div class="mb-3">
                        <label class="form-label" for="language">Langueage</label>
                        <input class="form-control" type="text" value={selectedBook.language} disabled readonly />
                        </div>

                </form>
                <div class="d-grid gap-2 d-md-flex justify-content-md-end">
                    <button type="button" onClick={(e) => { e.stopPropagation(), navigate(`/`) } } className="btn btn-primary">Back</button>
                    <button type="button" onClick={(e) => { e.stopPropagation(), navigate(`/${selectedBook.isbn}/update`) } } className="btn btn-warning">Update</button>
                    <button type="button" onClick={(e) => handleDelete(e, selectedBook.isbn)} className="btn btn-danger">Delete</button>
                </div>            
            </div>
    )
    }else{
        navigate(`/`)  
    }
}

export default BookDetail

